      }
    }

    return result;
  }

  /// Updates if the record exists, otherwise adds a new row

  /// <returns>Returns id
  Future<int> upsert() async {
    try {
      if (await _mnCache.rawInsert(
              'INSERT OR REPLACE INTO cache (id,title, imageUrl, sourceName, sourceImageUrl, content, dateTime)  VALUES (?,?,?,?,?,?,?)',
              [
                id,
                title,
                imageUrl,
                sourceName,
                sourceImageUrl,
                content,
                dateTime != null ? dateTime.millisecondsSinceEpoch : null
              ]) ==
          1) {
        saveResult = BoolResult(
            success: true, successMessage: 'Cache id=$id updated successfully');
      } else {
        saveResult = BoolResult(
            success: false, errorMessage: 'Cache id=$id did not update');
      }
      return id;
    } catch (e) {
      saveResult = BoolResult(
          success: false,
          errorMessage: 'Cache Save failed. Error: ${e.toString()}');
      return 0;
    }
  }

  /// inserts or replaces the sent List<<Cache>> as a bulk in one transaction.
  ///
  /// upsertAll() method is faster then saveAll() method. upsertAll() should be used when you are sure that the primary key is greater than zero
  ///
  /// Returns a BoolCommitResult
  Future<BoolCommitResult> upsertAll(List<Cache> caches) async {
    final results = await _mnCache.rawInsertAll(
        'INSERT OR REPLACE INTO cache (id,title, imageUrl, sourceName, sourceImageUrl, content, dateTime)  VALUES (?,?,?,?,?,?,?)',
        caches);
    return results;
  }

  /// Deletes Cache

  /// <returns>BoolResult res.success=Deleted, not res.success=Can not deleted
  Future<BoolResult> delete([bool hardDelete = false]) async {
    print('SQFENTITIY: delete Cache invoked (id=$id)');
    if (!_softDeleteActivated || hardDelete) {
      return _mnCache
          .delete(QueryParams(whereString: 'id=?', whereArguments: [id]));
    } else {
      return _mnCache.updateBatch(
          QueryParams(whereString: 'id=?', whereArguments: [id]),
          {'isDeleted': 1});
    }
  }

  CacheFilterBuilder select({List<String> columnsToSelect, bool getIsDeleted}) {
    return CacheFilterBuilder(this)
      .._getIsDeleted = getIsDeleted == true
      ..qparams.selectColumns = columnsToSelect;
  }

  CacheFilterBuilder distinct(
      {List<String> columnsToSelect, bool getIsDeleted}) {
    return CacheFilterBuilder(this)
      .._getIsDeleted = getIsDeleted == true
      ..qparams.selectColumns = columnsToSelect
      ..qparams.distinct = true;
  }

  void _setDefaultValues() {}
  // END METHODS
  // CUSTOM CODES
