  CacheField get not {
    _waitingNot = ' NOT ';
    return this;
  }

  CacheFilterBuilder equals(dynamic pValue) {
    param.expression = '=';
    cacheFB._addedBlocks = _waitingNot == ''
        ? setCriteria(pValue, cacheFB.parameters, param, SqlSyntax.EQuals,
            cacheFB._addedBlocks)
        : setCriteria(pValue, cacheFB.parameters, param, SqlSyntax.NotEQuals,
            cacheFB._addedBlocks);
    _waitingNot = '';
    cacheFB._addedBlocks.needEndBlock[cacheFB._blockIndex] =
        cacheFB._addedBlocks.retVal;
    return cacheFB;
  }

  CacheFilterBuilder equalsOrNull(dynamic pValue) {
    param.expression = '=';
    cacheFB._addedBlocks = _waitingNot == ''
        ? setCriteria(pValue, cacheFB.parameters, param, SqlSyntax.EQualsOrNull,
            cacheFB._addedBlocks)
        : setCriteria(pValue, cacheFB.parameters, param,
            SqlSyntax.NotEQualsOrNull, cacheFB._addedBlocks);
    _waitingNot = '';
    cacheFB._addedBlocks.needEndBlock[cacheFB._blockIndex] =
        cacheFB._addedBlocks.retVal;
    return cacheFB;
  }

  CacheFilterBuilder isNull() {
    cacheFB._addedBlocks = setCriteria(
        0,
        cacheFB.parameters,
        param,
        SqlSyntax.IsNULL.replaceAll(SqlSyntax.notKeyword, _waitingNot),
        cacheFB._addedBlocks);
    _waitingNot = '';
    cacheFB._addedBlocks.needEndBlock[cacheFB._blockIndex] =
        cacheFB._addedBlocks.retVal;
    return cacheFB;
  }

  CacheFilterBuilder contains(dynamic pValue) {
    if (pValue != null) {
      cacheFB._addedBlocks = setCriteria(
          '%${pValue.toString()}%',
          cacheFB.parameters,
          param,
          SqlSyntax.Contains.replaceAll(SqlSyntax.notKeyword, _waitingNot),
          cacheFB._addedBlocks);
      _waitingNot = '';
      cacheFB._addedBlocks.needEndBlock[cacheFB._blockIndex] =
          cacheFB._addedBlocks.retVal;
    }
    return cacheFB;
  }

  CacheFilterBuilder startsWith(dynamic pValue) {
    if (pValue != null) {
      cacheFB._addedBlocks = setCriteria(
          '${pValue.toString()}%',
          cacheFB.parameters,
          param,
          SqlSyntax.Contains.replaceAll(SqlSyntax.notKeyword, _waitingNot),
          cacheFB._addedBlocks);
      _waitingNot = '';
      cacheFB._addedBlocks.needEndBlock[cacheFB._blockIndex] =
          cacheFB._addedBlocks.retVal;
      cacheFB._addedBlocks.needEndBlock[cacheFB._blockIndex] =
          cacheFB._addedBlocks.retVal;
    }
