  }

  CacheFilterBuilder endsWith(dynamic pValue) {
    if (pValue != null) {
      cacheFB._addedBlocks = setCriteria(
          '%${pValue.toString()}',
          cacheFB.parameters,
          param,
          SqlSyntax.Contains.replaceAll(SqlSyntax.notKeyword, _waitingNot),
          cacheFB._addedBlocks);
      _waitingNot = '';
      cacheFB._addedBlocks.needEndBlock[cacheFB._blockIndex] =
          cacheFB._addedBlocks.retVal;
    }
    return cacheFB;
  }

  CacheFilterBuilder between(dynamic pFirst, dynamic pLast) {
    if (pFirst != null && pLast != null) {
      cacheFB._addedBlocks = setCriteria(
          pFirst,
          cacheFB.parameters,
          param,
          SqlSyntax.Between.replaceAll(SqlSyntax.notKeyword, _waitingNot),
          cacheFB._addedBlocks,
          pLast);
    } else if (pFirst != null) {
      if (_waitingNot != '') {
        cacheFB._addedBlocks = setCriteria(pFirst, cacheFB.parameters, param,
            SqlSyntax.LessThan, cacheFB._addedBlocks);
      } else {
        cacheFB._addedBlocks = setCriteria(pFirst, cacheFB.parameters, param,
            SqlSyntax.GreaterThanOrEquals, cacheFB._addedBlocks);
      }
    } else if (pLast != null) {
      if (_waitingNot != '') {
        cacheFB._addedBlocks = setCriteria(pLast, cacheFB.parameters, param,
