  CacheFilterBuilder greaterThanOrEquals(dynamic pValue) {
    param.expression = '>=';
    cacheFB._addedBlocks = _waitingNot == ''
        ? setCriteria(pValue, cacheFB.parameters, param,
            SqlSyntax.GreaterThanOrEquals, cacheFB._addedBlocks)
        : setCriteria(pValue, cacheFB.parameters, param, SqlSyntax.LessThan,
            cacheFB._addedBlocks);
    _waitingNot = '';
    cacheFB._addedBlocks.needEndBlock[cacheFB._blockIndex] =
        cacheFB._addedBlocks.retVal;
