  }

  CacheFilterBuilder lessThanOrEquals(dynamic pValue) {
    param.expression = '<=';
    cacheFB._addedBlocks = _waitingNot == ''
        ? setCriteria(pValue, cacheFB.parameters, param,
            SqlSyntax.LessThanOrEquals, cacheFB._addedBlocks)
